import '../styles/_listing.scss'

export default function Pagination()
{
    return(
        <div id="pagination">
            <ul classNmae="pages">
            <li>Prev</li>
            <li>1</li>
            <li>2</li>
            <li>3</li>
            <li>4</li>
            <li>Next</li>
            </ul>
        </div>
    )
}
